import React, { useState } from "react";
import {
  Stack,
  HStack,
  VStack,
  Input,
  FormControl,
  FormLabel,
  InputGroup,
  InputRightElement,
  Button,
  useStatStyles,
} from "@chakra-ui/react";

const Login = () => {
  const [show, setShow] = React.useState(false);
  const handleClick = () => setShow(!show);

  const [email, setEmail] = useState("");
  const [pass, setPass] = useState("");

  return (
    <VStack>
      <FormControl>
        <FormLabel color="white" margin="0">
          Email
        </FormLabel>
        <Input
          onChange={(e) => setEmail(e.target.value)}
          value={email}
          background="white"
          marginBottom="2"
          placeholder="Enter Email"
          _placeholder={{ opacity: 0.5, color: "blue" }}
        ></Input>
        <FormLabel color="white" margin="0">
          Password{" "}
        </FormLabel>
        <InputGroup size="md">
          <Input
            onChange={(e) => setPass(e.target.value)}
            value={pass}
            pr="4.5rem"
            type={show ? "text" : "password"}
            placeholder="Enter password"
            _placeholder={{ opacity: 0.5, color: "blue" }}
            background="white"
            margin="3px"
          />
          <InputRightElement width="4.5rem">
            <Button
              h="1.75rem"
              size="sm"
              onClick={handleClick}
              background="#b3d8f5"
              marginTop="8px"
            >
              {show ? "Hide" : "Show"}
            </Button>
          </InputRightElement>
        </InputGroup>

        <Button
          marginLeft="18%"
          w="60%"
          color="white"
          background="#2B4EFF"
          marginTop="15px"
          _hover={{ color: "#2B4EFF", background: "white" }}
        >
          {" "}
          Login
        </Button>
        <Button
          background="#2B4EFF"
          marginLeft="28%"
          w="30%"
          color="white"
          marginTop="15px"
          _hover={{ color: "#2B4EFF", background: "white" }}
        >
          {" "}
          Guest User
        </Button>
      </FormControl>
    </VStack>
  );
};

export default Login;
